import React from 'react'

const Header = () => {
  return (
    <div className='header bg-primary d-flex' >
        <img className='' width="70" src="data:image/png;base64," alt="logo" />
        <h3 className='text-light my-auto'>Info Notes</h3>
    </div>
  )
}

export default Header
